package com.gcp.ml.chatbot.chatbotengine.doc2vec;

import static com.gcp.ml.chatbot.chatbotengine.Config.LANG_EN;
import static com.gcp.ml.chatbot.chatbotengine.Config.LANG_KO;
import static com.gcp.ml.chatbot.chatbotengine.Config.NORMALIZE_ENTITY;
import static com.gcp.ml.chatbot.chatbotengine.Config.NORMALIZE_TRAIN;
import static com.gcp.ml.chatbot.chatbotengine.Config.OUT_OF_VOCAB;
import static com.gcp.ml.chatbot.chatbotengine.Config.PHRASE_EXTRACTION_ENTITY;
import static com.gcp.ml.chatbot.chatbotengine.Config.PHRASE_EXTRACTION_TRAIN;
