public class Doc2VecChatbotEngine implements ChatbotEngine{

	public ParagraphVectors vec = null;
	TokenizerFactory tokenFactory = null;
	EngineUtil engineUtil = new EngineUtil();


	public TokenizerFactory buildTokenizerFactory(String lang)
	{

		if (lang.equals(LANG_KO)) {
			tokenFactory = new CustomKoreanTokenizerFactory(NORMALIZE_TRAIN, STEMMING_TRAIN, PHRASE_EXTRACTION_TRAIN);
			tokenFactory.setTokenPreProcessor(new CommonPreprocessor());
		} else if (lang.equals(LANG_EN)){
			tokenFactory = new DefaultTokenizerFactory();
			tokenFactory.setTokenPreProcessor(new CommonPreprocessor());
		} else {
			// LANG_KO == default
			tokenFactory = new CustomKoreanTokenizerFactory(NORMALIZE_TRAIN, STEMMING_TRAIN, PHRASE_EXTRACTION_TRAIN);
			tokenFactory.setTokenPreProcessor(new CommonPreprocessor());
		}
		return tokenFactory;
	}

	/* -------------------- Doc2vec method -------------------- */
	public void training(String rawfile) throws IOException
	{
		System.out.println("\n----------- Build Chatbot engine ------------");
		ClassPathResource resource = new ClassPathResource(rawfile);
		File file = resource.getFile();
		SentenceIterator iter = new BasicLineIterator(file);
		AbstractCache<VocabWord> cache = new AbstractCache<VocabWord>();

		tokenFactory = buildTokenizerFactory(TOKENIZER_LANGUAGE);

		engineUtil.addDictToTokenizer();


		LabelsSource source = new LabelsSource("DOC_");

		vec = new ParagraphVectors.Builder()
				.minWordFrequency(5) //1
				.iterations(5)
				.epochs(1) //.epochs(20)
				.layerSize(100)
				.learningRate(0.025)
				.labelsSource(source)
				.windowSize(5)
				.iterate(iter)
				.trainWordVectors(true)
				.vocabCache(cache)
				.tokenizerFactory(tokenFactory)
				.sampling(0)
				.build();

		System.out.println("\n----------- Train Chatbot engine ------------");
        vec.fit();
	}



	public void upTraining(String rawfile) throws IOException
	{
		ClassPathResource resource = new ClassPathResource(rawfile);
		File file = resource.getFile();
		SentenceIterator iter = new BasicLineIterator(file);
		vec.setSentenceIterator(iter);
		engineUtil.addDictToTokenizer();

		int oldVocabNum = vec.getVocab().numWords();
		System.out.println("oldVocabNum: "+oldVocabNum);
		System.out.println("\n----------- Build new vocab ------------");
		vec.buildVocab(); //     
		int newVocabNum = vec.getVocab().numWords();
        System.out.println("newVocabNum: "+vec.getVocab().numWords());

		WeightLookupTable<VocabWord> oldLookUpTable = vec.getLookupTable();
        InMemoryLookupTable newLookUpTable = new InMemoryLookupTable.Builder()
																	.useAdaGrad(false)
																	.cache(vec.getVocab())
																	.negative(0.0D)
																	.useHierarchicSoftmax(true)
																	.vectorLength(100)
																	.lr(0.025D)
																	.build();
		newLookUpTable.setSyn0(Nd4j.rand(vec.getVocab().numWords(),100)); // columns  == doc2vec dim 

        System.out.println("\n----------- Add vectors to newLookupTable ------------");
		for (int i=0; i < newVocabNum; i++) {
            String word = vec.getVocab().elementAtIndex(i).getWord();
            if (i < oldVocabNum) //   vector newLookUpTable 
            {
                INDArray wordVector = oldLookUpTable.vector(word);
                newLookUpTable.putVector(word, wordVector);
            } else //     vector newLookUpTable 
            {
                INDArray wordVector = Nd4j.rand(1,100);
                newLookUpTable.putVector(word, wordVector);
            }
		}

		System.out.println("\n----------- Build new model (with new param) ------------");
		LabelsSource source = new LabelsSource("DOC_");
		vec = new ParagraphVectors.Builder()
				.minWordFrequency(1)
				.iterations(5)
				.epochs(10) //.epochs(20)
				.layerSize(100)
				.learningRate(0.025)
				.labelsSource(source)
				.windowSize(5)
				.iterate(iter)
				.trainWordVectors(true)
				.vocabCache(vec.getVocab())
				.tokenizerFactory(tokenFactory)
				.sampling(0)
				.build();

        vec.setLookupTable(newLookUpTable);

//        System.out.println("newVocabNum size:"+newVocabNum);
//        System.out.println("newLookupTable size:"+vec.getLookupTable().getWeights().size(0));

		System.out.println("\n----------- UpTrain Chatbot engine ------------");
		vec.fit();
	}

	public void save(String saveModelPath)
	{
		System.out.println("\n----------- Save Chatbot engine ------------");
		WordVectorSerializer.writeParagraphVectors(vec, saveModelPath);
	}

    public void load(String modelName, String lang) throws IOException
    {
		tokenFactory = buildTokenizerFactory(lang);
//		customKoreanTokenFactory = new CustomKoreanTokenizerFactory(NORMALIZE_TRAIN, STEMMING_TRAIN, PHRASE_EXTRACTION_TRAIN);
//		customKoreanTokenFactory.setTokenPreProcessor(new CommonPreprocessor());
		engineUtil.addDictToTokenizer();//      

        File file = new File(modelName);
        vec = WordVectorSerializer.readParagraphVectors(file);
		vec.setTokenizerFactory(tokenFactory);
        vec.getConfiguration().setIterations(1);
    }


	@Deprecated
	public double compare(String str1, String str2)
	{
	    try
        {
            INDArray vector1 = vec.inferVector(str1); //        // entity  user msg  oov 
            INDArray vector2 = vec.inferVector(str2);

            return Transforms.cosineSim(vector1, vector2);
        }
        catch (ND4JIllegalStateException e) // ToDo: entity      
        {
            return OUT_OF_VOCAB; // inferVector      -1 
        }
	}

	public List<String> nGrams(List<String> tokens, int n)
	{
		List<String> nGrams = new ArrayList<String>();
		for (int m = 1; m < n + 1; m++) { // n-gram loop
			for (int i = 0; i < tokens.size() - m + 1; i++) { // i-th token loop
				String tempNgram = "";
				for (int j = 0; j < m; j++) { // j-th token loop
					tempNgram += " " + tokens.get(i + j);
				}
				nGrams.add(tempNgram);
			}
		}
		return nGrams;
	}

