	/* -------------------- Intent method -------------------- */
	@Deprecated
	public List<IntentResult> getIntentScore(List<String> sampleIntentStr, String userMessage) 
	{
		List<IntentResult> list = new ArrayList<IntentResult>();
		for(String intentStr : sampleIntentStr)
		{
			Doc2VecIntentResult obj = new Doc2VecIntentResult();
			obj.setComparedStr(intentStr);
			obj.setScore(compare(intentStr, userMessage));
			list.add(obj);
		}

		return list;
	}

	@Deprecated
	public IntentResult getIntentMaxScore(List<String> sampleIntentStr, String userMessage) 
	{
		double maxScore = -999.0; // vec similarity      score 0  -1 ,  -1 
		Doc2VecIntentResult maxObj = new Doc2VecIntentResult();
        maxObj.setComparedStr("");
        maxObj.setScore(0);

		for(String intentStr : sampleIntentStr)
		{
			double score = compare(intentStr, userMessage);
			Doc2VecIntentResult obj = new Doc2VecIntentResult();
			obj.setComparedStr(intentStr);
			obj.setScore(score);
			if(maxScore <= score)
			{
				maxScore = score;
				maxObj = obj;
			}
		}
		return maxObj;
	}

	public List<IntentResult> getIntentScore(List<INDArray> sampleIntentVec, INDArray userMessageVec) {
		// TODO Auto-generated method stub
		List<IntentResult> list = new ArrayList<IntentResult>();
		for(INDArray intentVec : sampleIntentVec)
		{
			Doc2VecIntentResult obj = new Doc2VecIntentResult();
			obj.setComparedStr("");
			obj.setScore(compare(intentVec, userMessageVec));
			list.add(obj);
		}
		return list;
	}

	public IntentResult getIntentMaxScore(List<INDArray> sampleIntentVec, INDArray userMessageVec) {
		// TODO Auto-generated method stub
		double maxScore = -999.0; // vec similarity      score 0  -1 ,  -1 
        Doc2VecIntentResult maxObj = new Doc2VecIntentResult();
        maxObj.setComparedStr("");
        maxObj.setScore(0);

		double score = 0.0;
		Doc2VecIntentResult obj = null;
		for(INDArray intentVec : sampleIntentVec)
		{
			score = compare(intentVec, userMessageVec);
			obj = new Doc2VecIntentResult();
			obj.setComparedStr("");
			obj.setScore(score);
			if(maxScore <= score)
			{
				maxScore = score;
				maxObj = obj;
			}
		}
		return maxObj;
	}

	public INDArray getVector(String str) {
		// TODO Auto-generated method stub
		try
        {
            return vec.inferVector(str);
        }
        catch (Exception e)
        {
            return null;
        }
	}

	public List<INDArray> getVectorList(List<String> strList) {
		// TODO Auto-generated method stub
		List<INDArray> list = new ArrayList<INDArray>();
		for(String str : strList)
		{
			INDArray vec = getVector(str);
			if(vec != null)
			{
				list.add(vec);
			}
		}
		return list;
	}

	public double compare(INDArray vec1, INDArray vec2) {
		// TODO Auto-generated method stub
		if(vec1 == null || vec2 == null) 
		{
			return 0.0;
		} 
		else 
		{
			return Transforms.cosineSim(vec1, vec2);
		}
	}
}
